import './App.css';
import Logo from "./Images/Logo.png";
import Soutside from './Images/soutside2.png';
import Wave from "./Images/wavehand.png"

function Main() {
  return (
    <div className = 'MainContent'>
        <img className = 'MainImage' src = {Soutside}></img>
        <span className = 'MainImageLabel'>Hello, I'm Seth</span>
        <span className='MainRole'>Front-end Developer</span>
        <span className='MainDesc'>I specialize in the development of high quality front end applications.</span>
    </div>
  );
}

export default Main;
